import React from 'react';

function Home() {
  const email = "example@example.com"; // Replace with the actual email

  return (
    <div id="dashboard">
      <div className="main-content">
        <h1>Dashboard</h1>
        <div className="email-container">
          <h2>Email: {email}</h2>
        </div>
      </div>
    </div>
  );
}

export default Home;
